import PlasticImage from './chelsea1.png';
import PlasticImage2 from './chelsea2.png';
import EwasteImage from './dortmund1.png';
import EwasteImage2 from './dortmund2.png';
import OrganicImage from './juve1.png';
import OrganicImage2 from './juve2.png';
import GlassImage from './leicester1.png';
import GlassImage2 from './leicester2.png';
import LiverpoolDepan from './liverpool1.png';
import LiverpoolBelakang from './liverpool2.png';
import MadridDepan from './madrid1.png';
import MadridBelakang from './madrid2.png';
import MilanDepan from './milan1.png';
import MilanBelakang from './milan2.png';
import MunchenDepan from './munchen1.png';
import MunchenBelakang from './munchen2.png';

export {
  PlasticImage,
  PlasticImage2,
  EwasteImage2,
  EwasteImage,
  OrganicImage2,
  OrganicImage,
  GlassImage2,
  GlassImage,
  LiverpoolBelakang,
  LiverpoolDepan,
  MadridBelakang,
  MadridDepan,
  MilanBelakang,
  MilanDepan,
  MunchenDepan,
  MunchenBelakang,
};
